import React, { Component, useState } from 'react';
import { FormControl, FormLabel, FormHelperText, Input, InputLabel, makeStyles, TextField, Button } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        '& > *': {
            margin: theme.spacing(1),
        },
    },
}));

function NewShowForm(props){
    const classes = useStyles();

    const [newShow, setShow] = useState({
        comedian_id: 5,
        date: "",
        is_virtual: false,
        venue: "",
        address: "",
        phone_number: "",
        ticket_link: "",
        ticket_price: 0,
        venue_website: ""
    })

    const changeHandler = (e) => {
        const { name, value } = e.target
        setShow({ ...newShow, [name]: value })
    }

    // const signupHandler = (e) => {
    //     e.preventDefault()
    //     props.signupHandler(newComedian)
    // }




    console.log("new show form props", props)
    return(
        <>
            <h2>New Show From</h2>
            <FormControl>
                <form className={classes.root} noValidate autoComplete="off" >
                    <TextField id="standard-basic" name="date" label="Date" value={newShow.date} onChange={changeHandler} />
                    <TextField id="standard-basic" name="is_virtual" label="Is this show virtual?" value={newShow.is_virtual} onChange={changeHandler} />
                    <TextField id="standard-basic" name="venue" label="Venue Name" value={newShow.venue} onChange={changeHandler} />
                    <TextField id="standard-basic" name="address" label="Address" value={newShow.address} onChange={changeHandler} />
                    <TextField id="standard-basic" name="phone_number" label="Phone Number" value={newShow.phone_number} onChange={changeHandler} />
                    <TextField id="standard-basic" name="ticket_link" label="City" value={newShow.ticket_link} onChange={changeHandler} />
                    <TextField id="standard-basic" name="ticket_price" label="Genre" value={newShow.ticket_price} onChange={changeHandler} />
                    <TextField id="standard-basic" name="venue_website" label="Genre" value={newShow.venue_website} onChange={changeHandler} />
                    <Button type="submit">Submit</Button>
                    {/* <TextField id="filled-basic" label="Filled" variant="filled" />
                <TextField id="outlined-basic" label="Outlined" variant="outlined" /> */}
                </form>
            </FormControl>
        </>
    )
}

export default NewShowForm
